import { useContext } from 'react';
import { AppContext } from './context/appContext';

export const RecentArtists = () => {
    const {
        monthlyArtists
    } = useContext(AppContext)

    return(
        <div>
            {monthlyArtists.items ? 
            monthlyArtists.items.map(artist => 
                <>
                    <h4> {artist.name} </h4>
                </>)
                : 
                null
                }
            <p> recent artists placeholder </p>
        </div>
    )
}
